import React, { useEffect, useState } from "react";
import { getDocuments } from "../services/api";

export default function DocumentList({ onSelect }) {
  const [docs, setDocs] = useState([]);
  useEffect(() => {
    getDocuments().then(setDocs);
  }, []);

  return (
    <div>
      <h3>Documents</h3>
      <ul>
        {docs.map(d => (
          <li key={d.id}>
            {/* <button onClick={()=>onSelect(d.id)}>{d.title || d.file}</button> */}
            <button onClick={() => onSelect(d.id)}>
  {d.title || d.file.split("/").pop()}
</button>

            <span> â€” {d.status}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}
